			attributes.appendChild(x);
		}

		offer_node_sub.appendChild(attributes);
	}
	function set_page(npage) {
		while (wyniki.firstChild)
    			wyniki.removeChild(wyniki.lastChild);
		if (npage < 0 || npage > total_pages)
			return;
        page = npage;
		var end = page*per_page_limit+50;
		if (end > oferty_length)
			end = oferty_length;
		for (var i = page*per_page_limit; i < end; i++)
			add_node(oferty[i]);
        set_pagers();
	}
    function set_pagers() {
        function insert_tile(x,a,b) {
            var p = document.createElement('div');
            p.className = 'pager-tile';
            p.onclick = function() {set_page(a)};
            p.appendChild(document.createTextNode(b));
            x.appendChild(p);
        }
        function insert_btile(x,a) {
            var p = document.createElement('div');
            p.className = 'pager-btile';
            p.appendChild(document.createTextNode(a));
            x.appendChild(p);
        }
        var x = document.getElementsByClassName('pager');
        for (var g = 0; g < x.length; g++) {
		    while (x[g].firstChild)
    			x[g].removeChild(x[g].lastChild);
            var off;
            var r;
            if (page > 5)
                insert_tile(x[g],1,'<<');
            
            if (page%10 < 4)
                off = 10;
            else
                off = 0;
            for (var i = 20+off; i >= 0+off; i-=10) { 
                if ((page-(page%10))-i > 0) {
                    r = (page-(page%10))-i;
                    insert_tile(x[g],r,r.toString());
                }
            }
            if (page > 13)
                insert_btile(x[g],'|');
            
            for (var i = 3; i >= 1; i--) {
                if (page-i <= 0)
                    continue;
                r = page-i;
                insert_tile(x[g],r,r.toString());
            }
            
            insert_btile(x[g],page.toString());
            
            for (var i = page+1; i <= total_pages && i < (page+4); i++)
                insert_tile(x[g],i,i.toString());
            if (total_pages > page+4)
                insert_btile(x[g],'|');
            if (page%10 > 6)
                off = 10;
            else
                off = 0;
            for (i = 10+off; i < 40+off; i+=10) { 
                r = (page-(page%10))+i;
                if (r < total_pages) {
                    insert_tile(x[g],r,r.toString());
                } else {
                    break;
                }
            }
            if (page+3 < total_pages)
                insert_tile(x[g],total_pages,'>>');
        }
    }
	set_page(page);
      </script>
